export function Validate (endpoint) {
	return endpoint.interface === 1 && endpoint.usage === 0x0092 && endpoint.usage_page === 0xff1c
}

export function Image() {
	return ""
}

function hexToRgb (hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex)
	let colors = []

	colors[0] = parseInt(result[1], 16)
	colors[1] = parseInt(result[2], 16)
	colors[2] = parseInt(result[3], 16)

	return colors
}

function sendFlushPacket () {
    let packet = [0x04,0xde,0x01,0x06,0x18,0x00,0x00,0x00,0x00,0x13,0x04,0x02,0xb1,0x00]

    device.write(packet, 64)
    device.read(packet, 64)
}

function StreamPacket (data, ids) {
    let packet = [
        0x04,
        ids[0],
        ids[1],
        0x0b,
        0x18,
        ids[2],
        ids[3],
        0x00
    ]

    packet = packet.concat(data)

    device.write(packet, 64)
    device.read(packet, 64)

    device.pause(1)
}

function sendColors (shutdown = false) {
    const RGBData = new Array(112 * 3).fill(0)

    for (let iIdx = 0; iIdx < vKeys.length; iIdx++) {
        const iPxX = vKeyPositions[iIdx][0], iPxY = vKeyPositions[iIdx][1]

        var col

        if (shutdown)
            col = hexToRgb(shutdownColor)
        else if (LightingMode === "Forced")
            col = hexToRgb(forcedColor)
        else
            col = device.color(iPxX, iPxY)

        let i = vKeys[iIdx]*3

        RGBData[i-3] = col[0] //R
        RGBData[i-2] = col[1] //G
        RGBData[i-1] = col[2] //B
    }
    
    StreamPacket(RGBData.splice(0, 24), [ 0xf7, 0x15, 0x00, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x0b, 0x18, 0x18, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x23, 0x18, 0x30, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x3b, 0x18, 0x48, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x53, 0x18, 0x60, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x6b, 0x18, 0x78, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x83, 0x18, 0x90, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x9b, 0x18, 0xa8, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0xb3, 0x18, 0xc0, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0xe3, 0x0c, 0xd8, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0xe3, 0x18, 0xf0, 0x00 ])
    StreamPacket(RGBData.splice(0, 24), [ 0xfc, 0x17, 0x08, 0x01 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x14, 0x18, 0x20, 0x01 ])
    StreamPacket(RGBData.splice(0, 24), [ 0x2c, 0x18, 0x38, 0x01 ])

    sendFlushPacket()

    device.pause(1)
}

function sendStupidColor () {
    let packet = [], mode = 0x00, color = hexToRgb(presetColor)

    switch (preset) {
        case 'Corrugated':
            mode = 0x01
            break
        case 'Cloud':
            mode = 0x02
            break
        case 'Serpentine':
            mode = 0x03
            break
        case 'Spectrum':
            mode = 0x04
            break
        case 'Breath':
            mode = 0x05
            break
        case 'Normal':
            mode = 0x06
            break
        case 'Reaction':
            mode = 0x07
            break
        case 'Ripples':
            mode = 0x08
            break
        case 'Traverse':
            mode = 0x09
            break
        case 'Stars':
            mode = 0x0a
            break
        case 'Flowers':
            mode = 0x0b
            break
        case 'Roll':
            mode = 0x0c
            break
        case 'Wave':
            mode = 0x0d
            break
        case 'Cartoon':
            mode = 0x0e
            break
        case 'Rain':
            mode = 0x0f
            break
        case 'Scan':
            mode = 0x10
            break
        case 'Surmount':
            mode = 0x11
            break
        case 'Speed':
            mode = 0x12
            break
        case 'Custom':
            mode = 0x13
            break
        case 'Audiowave':
            mode = 0x14
            break
        case 'Capture':
            mode = 0x15
            break
    }

    packet = [0x04,0xda,0x01,0x06,0x18,0x00,0x00,0x00,0x00,mode,0x04,0x02,0xb1,0x00]

    packet.push(color[0])
    packet.push(color[1])
    packet.push(color[2])

    device.write(packet, 64)
}